import { defineMessages } from 'react-intl';

export const scope = 'app.containers.Sidebar';

export default defineMessages({
  garaazAdmin: {
    id: `${scope}.garaazAdmin`,
    defaultMessage: 'Garaaz Distributor',
  },
  distributor: {
    id: `${scope}.distributor`,
    defaultMessage: 'Distributor',
  },
  home: {
    id: `${scope}.home`,
    defaultMessage: 'Home',
  },
  branch: {
    id: `${scope}.branch`,
    defaultMessage: 'Branch',
  },

  employee: {
    id: `${scope}.employee`,
    defaultMessage: 'Employee',
  },
  part: {
    id: `${scope}.part`,
    defaultMessage: 'Part',
  },
  parts: {
    id: `${scope}.parts`,
    defaultMessage: 'Parts',
  },
  orders: {
    id: `${scope}.orders`,
    defaultMessage: 'Orders'
  },
  workshops: {
    id: `${scope}.workshops`,
    defaultMessage: 'Workshops'
  },
  sales: {
    id: `${scope}.sales`,
    defaultMessage: 'Sales'
  },
  logout: {
    id: `${scope}.logout`,
    defaultMessage: 'Logout',
  },
  hindi: {
    id: `${scope}.hindi`,
    defaultMessage: 'Hin',
  },
  accounting: {
    id: `${scope}.accounting`,
    defaultMessage: 'Accounts',
  },
  outstanding: {
    id: `${scope}.outstanding`,
    defaultMessage: 'Outstandings',
  },
  collections: {
    id: `${scope}.collections`,
    defaultMessage: 'Collections',
  },
  inventory: {
    id: `${scope}.inventory`,
    defaultMessage: 'Inventory',
  },
  stockTransfer: {
    id: `${scope}.stockTransfer`,
    defaultMessage: 'Stock Transfer',
  },
  placeOrder: {
    id: `${scope}.placeOrder`,
    defaultMessage: 'Place Order',
  }
 
});
